import React from "react";
import {Container} from 'react-bootstrap'

let ListAction = ({gategory, allgategory}) => {

    return (
        <div className="menu">
            <Container>
                <div className="text">Menu Food</div>
                <div>
                <div className="actionMenu">
                {
                    allgategory.map((cate) => {
                        return (
                            <div>
                            <span onClick={() => gategory(cate)}>{} </span>
            
                            </div>
                        )
                    })
                }
                </div>

                </div>
            </Container>
        </div>
    )
}

export default ListAction
